import React from 'react';
import { Link } from 'react-router-dom';
import '../../../css/blog/archive.css';

export default class PresentationItem extends React.Component {
  render() {
    return (
      <div className="archive-list-area">
          <div className="archive-itemlist"><ul><li>
          <Link to={this.props.url}>{this.props.name}</Link><span>{this.props.description}</span></li></ul>
          </div>
        </div>
    );
  }
}
